import React from 'react';
import './FinancialsPage.css'
import TransfersTable from './TransfersTable';

const FinancialsPage = (props) => {
    return (
        <div className="DI_FinancialsPage_main">
            <div className="DI_FP_Transfers_Table_wrapper">
                <div>
                    <div className="DI_FP_Transfers_Title" >
                        {'Transfers'}
                    </div>
                    <div className="DI_FP_Export_Wrapper" onClick={() => {
                    }}>
                        <div className="DI_FP_Export_Text" >
                        </div>
                        <div className="DI_FP_Export_Icon" >
                            <i className="fa fa-arrow-down" />
                        </div>
                    </div>
                </div>
                <div className="DI_FP_Transfers_Table_main">
                    <TransfersTable />
                </div>
            </div>
        </div>
    )
}

export default FinancialsPage;
